import classNames from "classnames";

import { FlagIcon } from "@/components/FlagIcon";
import { Icon, Icons } from "@/components/Icon";
import { Context } from "@/components/player/internals/ContextUtils";
import { useOverlayRouter } from "@/hooks/useOverlayRouter";
import { Caption } from "@/stores/player/slices/source";
import { usePlayerStore } from "@/stores/player/store";

const source: Caption = {
  language: "nl",
  url: "test",
  srtData: ``,
};
source.srtData = new TextDecoder().decode(
  Uint8Array.from(
    [...atob(source.srtData)].map((m) => m.codePointAt(0) as number)
  )
);

export function CaptionOption(props: {
  countryCode?: string;
  children: React.ReactNode;
  selected?: boolean;
  onClick?: () => void;
}) {
  return (
    <div
      className="grid grid-cols-[auto,1fr,auto] items-center gap-3 rounded -ml-3 -mr-3 px-3 py-2 cursor-pointer hover:bg-video-context-border"
      onClick={props.onClick}
    >
      <div>
        <FlagIcon countryCode={props.countryCode} />
      </div>
      <span
        className={classNames(props.selected && "text-white", "font-medium")}
      >
        {props.children}
      </span>
      {props.selected ? (
        <Icon
          icon={Icons.CIRCLE_CHECK}
          className="text-xl text-video-context-type-accent"
        />
      ) : null}
    </div>
  );
}

export function CaptionsView({ id }: { id: string }) {
  const router = useOverlayRouter(id);
  const setCaption = usePlayerStore((s) => s.setCaption);
  const lang = usePlayerStore((s) => s.caption.selected?.language);

  function updateCaption() {
    setCaption(source);
  }

  function disableCaption() {
    setCaption(null);
  }

  const langs = [
    { lang: "nl", title: "Nederlands" },
    { lang: "gr", title: "Greece" },
  ];

  return (
    <>
      <Context.BackLink
        onClick={() => router.navigate("/")}
        rightSide={
          <button
            type="button"
            onClick={() => router.navigate("/captions/settings")}
          >
            Customize
          </button>
        }
      >
        Captions
      </Context.BackLink>
      <Context.Section>
        <CaptionOption onClick={() => disableCaption()}>Off</CaptionOption>
        {langs.map((v) => (
          <CaptionOption
            key={v.lang}
            countryCode={v.lang}
            selected={lang === v.lang}
            onClick={() => updateCaption()}
          >
            {v.title}
          </CaptionOption>
        ))}
      </Context.Section>
    </>
  );
}
